div.style:
font-family: Arial, sans-serif;
font-size: 36px;
line-height: 1.2;
font-weight: 800;
text-align: left;
word-wrap: break-word;
overflow-wrap: break-word;
white-space: normal;

background: linear-gradient(
  90deg,
  #00F5FF,
  #8A2BE2,
  #FF00FF,
  #FF6347,
  #00F5FF
);
background-size: 300% 300%;
-webkit-background-clip: text;
background-clip: text;
color: transparent;

animation: gradientMove 6s ease infinite;

color: #FFFFFF; font-family: Arial, sans-serif; font-size: 
      20px; line-height: 1.6; text-align: justify; font-weight: 400; 
      white-space: pre-wrap; max-height: 590px; overflow-y: auto; 
      padding-right: 10px; text-shadow: 0 0 3px #EDEDF4, 0 0 6px #EDEDF4, 0 0 12px #5271FF, 
      0 0 24px #5271FF;
